        'motor': 'ACEITE MOBIL 15W-40 FULL PROTEC. MOTOR',
        'diferencial': 'ACEITE MOBILUBE HD 85W-140',
        'reductor': 'ACEITE MOBILUBE HD 80W-90 CAJA',
        'servotrans': 'ACEITE M-MOBILTRANS HD 30 DRUM-L'
