  list_component.redraw();
  return context.executeAction({
    "Name": "/appconsumos_mb/Actions/GenericToastMessage.action",
    "Properties": {
      "Message": `Nuevo material agregado`,
      "Duration": 1,
      "ShowActivityIndicator": true
    }
  });
